import React, { useEffect } from 'react';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import { useSelector, useDispatch } from 'react-redux';
import { mapSlice } from '../redux/mapSlice';
import { width } from '@mui/system';
import ResultCard from './resultcard';
import { createMarker } from './mapapi';
import { getMapObject } from './gmap';

export default function ResultDrawer(props) {

    let searchResults = props.results;
    let resultsListToggle = useSelector(state => state.mapSlice.resultsListToggle);

    for (let i = 0; i <= searchResults.length; i++) {


    }


    return (

        <Drawer
            anchor='left'
            open={resultsListToggle}
            variant="persistent"
            PaperProps={{
                sx: {
                    marginTop: 8,
                    width: 400,
                }
            }}
        >

            <Box>
                {(() => {
                    const d = [];
                    for (let i = 0; i <= searchResults.length; i++) {
                        if(!searchResults[i]){
                            d.push(<ResultCard name='検索してみましょう' vicinity='例'></ResultCard>);
                            continue;
                        }


                        let r = searchResults[i];
                        createMarker(r.lat,r.lng, getMapObject());
                        d.push(<ResultCard name={r.name} vicinity={r.vicinity}></ResultCard>);
                    }
                    return d;
                })()}

            </Box>
        </Drawer>

    )


}

